import React,{useState, useEffect} from "react";
import Card from './Card';
import {robots} from './robots';



const CardList=()=>{

	return (

		<div>
		{	
			robots.map((user,i)=>{
				<Card robot={robots[i]} />
			})
		}
		</div>		
	);
}

export default CardList;
